    <!--Used in proxysearch to enable/disable start/end date-->
    <script language="JavaScript">
        
        
        function enable_text01(status)
        {
          if (status == true) {
          $('#startdate01').hide();
          $('#enddate01').hide();
          }
          else { 
          $('#startdate01').show();
          $('#enddate01').show();
          }
        }
        
        function enable_text02(status)
        {
          if (status == true) {
          $('#startdate02').hide();
          $('#enddate02').hide();
          }
          else { 
          $('#startdate02').show();
          $('#enddate02').show();
          }
        }
  
        //Used to add up count of items in shopping cart
  
        function count_item()
        {
          var old = $('#itemcount').val();
          $('#itemcount').val(parseFloat(old) + 1);
  
        }
  

        
    </script>
